import React from 'react';
import PropTypes from 'prop-types';
import MyContext from './AppContext';

export default function Provider({ children }) {
  return (
    <MyContext.Provider>
      { children }
    </MyContext.Provider>
  );
}

Provider.propTypes = {
  children: PropTypes.node.isRequired,
};
